import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';
const disabledDates = [
    new Date(2018, 0, 1),
    new Date(2018, 1, 2),
  ];
const  ParkingCalendar=()=>{

    return(
        <div>
            <Calendar
            tileDisabled={({ date }) => {
                date.getDay('Sunday')===0;
                date.getDay('Saturday')===1;

            }}
            ></Calendar>
        </div>
    )
}
export default ParkingCalendar;
